import { motion } from "framer-motion";
import React from "react";
function About() {
  return (
    <>
      <motion.div
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true }}
        transition={{ delay: 0.5, duration: 0.5 }}
      >
        <div className="about-title">
          <p>Half developer,</p>
          <p>half designer,</p>
          <p>full creative</p>
        </div>
      </motion.div>
    </>
  );
}

export default About;
